import React from "react";

function Login() {
    return (
        <div className="container">
            <h1>Add New Book</h1>
            <p>{contact.email}</p>
            <form onSubmit={onSubmit}>
                <input
                    onChange={update}
                    name="name"
                    placeholder="Book Name"
                    value={contact.name}
                />
                <input
                    onChange={update}
                    name="author"
                    placeholder="Book Author"
                    value={contact.author}
                />
            
                <button type="submit"> Submit</button>
            </form>
        </div>
    );
}

export default Login;
